package ejJava03;

public class Ej9 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println("Escribo la tabla de multiplicar.");
		
		for (int i = 1; i <= 10; i++) {
			for (int j = 1; j <= 10; j++) {
				System.out.println(i+"*"+j+"= "+ i*j);
			}
		}
	}

}
